import styled from "styled-components";

export default {
  Container: styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
    padding-left: 80px;
    height: 65px;
    box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.07);
  `,
  Logo: styled.img`
    width: 53px;
    height: 53px;
  `,
};
